    "SixthFurther" : MessageLookupByLibrary.simpleMessage("Após a rotina de dormir, certifique-se de começar o treinamento apenas quando o bebê estiver sonolento, mas acordado. Certifique-se de que o bebê esteja em um ambiente seguro e que você possa ouvir o choro do lado de fora do quarto. Se tiver um monitor de bebê, certifique-se de poder ver o bebê. Mas um monitor de bebê não é essencial para o treinamento do sono. Cada bebê é diferente e especial à sua maneira. A maioria leva de 3 a 7 dias para aprender a se acalmar, enquanto outros levam mais tempo. O choro e o tempo para dormir reduzirão perceptivelmente mais rápido conforme os dias passam. Um pai grato nos contou que seu bebê chorou por um total de 16 minutos no primeiro dia, seguido por 8 minutos no próximo dia, 6 minutos no próximo dia e estava dormindo em 3 minutos no quarto dia."),
